window.bookSummaryJSON = "<p><b>The thrilling adventure based on the acclaimed TV series </b><b><i>Star Trek: Picard</i></b><b>!</b><br> <br> Following the explosive events seen in season one of <i>Star Trek: Picard</i>, Raffi Musiker finds herself torn between returning to her old life as a Starfleet Intelligence officer or something a little more tame—teaching at the Academy, perhaps. The decision is made for her though when a message from an old contact—a Romulan spy—is received, asking for immediate aid. With the help of Elnor and assistance from Jean-Luc Picard, Raffi decides to take on this critical mission—and quickly learns that past sins never stay buried. Finding the truth will be complicated, and deadly…<br> <br> ™, ®, &amp; © 2023 CBS Studios, Inc. STAR TREK and related marks and logos are trademarks of CBS Studios, Inc. All Rights Reserved.</p>"; 
